import React from "react";
import OrganSelect from "./OrganSelect.js";

const OrganList = ({organs}) => {
    const organList = organs.map(organ => {
        return (
        <>
        <OrganSelect 
         key={organ._id}
         organ = {organ}/> 
        </>)


    })

    return ( 
        <section>
            <h2>Choose your organ:</h2>
            <div>
                {organList}
            </div>
        </section>
     );
}

export default OrganList;
